(55, 'Google feeling lucky.', 'Google is one of the most famous Internet search engines which hosts and develops a number of Internetbased\r\nservices and products. On its search engine website, an interesting button â€˜Iâ€™m feeling luckyâ€™\r\nattracts our eyes. This feature could allow the user skip the search result page and goes directly to the\r\nfirst ranked page. Amazing! It saves a lot of time.\r\nThe question is, when one types some keywords and presses â€˜Iâ€™m feeling luckyâ€™ button, which web\r\npage will appear? Google does a lot and comes up with excellent approaches to deal with it. In this\r\nsimplified problem, let us just consider that Google assigns every web page an integer-valued relevance.\r\nThe most related page will be chosen. If there is a tie, all the pages with the highest relevance are\r\npossible to be chosen.\r\nYour task is simple, given 10 web pages and their relevance. Just pick out all the possible candidates\r\nwhich will be served to the user when â€˜Iâ€™m feeling luckyâ€™.\r\nInput\r\nThe input contains multiple test cases. The number of test cases T is in the first line of the input file.\r\nFor each test case, there are 10 lines, describing the web page and the relevance. Each line contains\r\na character string without any blank characters denoting the URL of this web page and an integer\r\nVi denoting the relevance of this web page. The length of the URL is between 1 and 100 inclusively.\r\n(1 â‰¤ Vi â‰¤ 100)\r\nOutput\r\nFor each test case, output several lines which are the URLs of the web pages which are possible to be\r\nchosen. The order of the URLs is the same as the input. Please look at the sample output for further\r\ninformation of output format.\r\n\r\n\r\nSample Input\r\n2\r\nwww.youtube.com 1\r\nwww.google.com 2\r\nwww.google.com.hk 3\r\nwww.alibaba.com 10\r\nwww.taobao.com 5\r\nwww.bad.com 10\r\nwww.good.com 7\r\nwww.fudan.edu.cn 8\r\nwww.university.edu.cn 9\r\nacm.university.edu.cn 10\r\nwww.youtube.com 1\r\nwww.google.com 2\r\nwww.google.com.hk 3\r\nwww.alibaba.com 11\r\nwww.taobao.com 5\r\nwww.bad.com 10\r\nwww.good.com 7\r\nwww.fudan.edu.cn 8\r\nacm.university.edu.cn 9\r\nacm.university.edu.cn 10\r\n\r\n\r\nSample Output\r\nCase #1:\r\nwww.alibaba.com\r\nwww.bad.com\r\nacm.university.edu.cn\r\nCase #2:\r\nwww.alibaba.com', 'uva', '2\r\nwww.youtube.com 1\r\nwww.google.com 2\r\nwww.google.com.hk 3\r\nwww.alibaba.com 10\r\nwww.taobao.com 5\r\nwww.bad.com 10\r\nwww.good.com 7\r\nwww.fudan.edu.cn 8\r\nwww.university.edu.cn 9\r\nacm.university.edu.cn 10\r\nwww.youtube.com 1\r\nwww.google.com 2\r\nwww.google.com.hk 3\r\nwww.alibaba.com 11\r\nwww.taobao.com 5\r\nwww.bad.com 10\r\nwww.good.com 7\r\nwww.fudan.edu.cn 8\r\nacm.university.edu.cn 9\r\nacm.university.edu.cn 10', 'Case #1:\r\nwww.alibaba.com\r\nwww.bad.com\r\nacm.university.edu.cn\r\nCase #2:\r\nwww.alibaba.com\r\n', '', 3.00),
(58, 'IP Checking', 'An IP address is a 32 bit address formatted in the following way\r\n\r\na.b.c.d\r\n\r\nwhere a, b, c, d are integers each ranging from 0 to 255. Now you are given two IP addresses, first one in decimal form and second one in binary form, your task is to find if they are same or not.\r\n\r\nInput\r\nInput starts with an integer T (â‰¤ 100), denoting the number of test cases.\r\n\r\nEach case starts with two lines. First line contains an IP address in decimal form, and second line contains an IP address in binary form. In binary form, each of the four parts contains 8 digits. Assume that the given addresses are valid.\r\n\r\nOutput\r\nFor each case, print the case number and "Yes" if they are same, otherwise print "No".\r\n\r\nSample Input\r\n\r\n2\r\n192.168.0.100\r\n11000000.10101000.00000000.11001000\r\n65.254.63.122\r\n01000001.11111110.00111111.01111010\r\n\r\nOutput for Sample Input\r\n\r\nCase 1: No\r\nCase 2: Yes\r\n \r\n\r\nPROBLEM SETTER: JANE ALAM JAN', 'lightoj', '3\r\n80.239.242.53\r\n01010000.11101111.11110010.00110101\r\n118.98.235.40\r\n01000001.11111110.00111111.01111010\r\n141.0.11.253\r\n10001101.00000000.00001011.11111101', 'Case 1: Yes\r\nCase 2: No\r\nCase 3: Yes\r\n', 'Case 1: Yes\nCase 2: No\nCase 3: Yes\n', 3.00),
(60, 'Alice And ChessBoard', 'Itâ€™s Sunday afternoon, and Alice is in her room trying to figure out the rules of the game called Chess. She thinks sheâ€™s almost got it, but sheâ€™d like your help.\r\n\r\nAlice has placed a bishop on an empty chessboard. Given the position of the bishop and the positon of another square on the chessboard, Alice would like to know if the bishop can travel to that square in one move or not.\r\n\r\nChess is a game played on an 8*8 rectangular board. The rows of the board are numbered from 1â€¦8 and similarly the columns are numbered from 1â€¦8. (For this problem, you may assume that the rows are numbered from 1 to 8 from top to bottom and the columns are numbered from 1 to 8 from left to right). The bishop occupies a single square on the board (as does every other piece) and it can move any number of squares diagonally, but it cannot travel outside the board. Below is a picture demonstrating the moves of a bishop. The dotted squares are the squares the bishop can travel to in one move.\r\n\r\nlink\r\n\r\nInput\r\n\r\nIn the first line of input, there is a number T (1 â‰¤ T â‰¤ 200) denoting the number of test cases. Each of the next T lines contains the description of the T testcases. Each testcase contains four integers in a single line. The first two integer denotes the row and the column of the position of the bishop respectively and the second two integers denotes the row and the column of the postion of the targeted square respectively. It is guaranteed that the two squares wonâ€™t be the same. And of course, each of these integers will be between 1 and 8.\r\n\r\nOutput\r\n\r\nFor each test case, print â€œYesâ€ (without the quote) in a single line if the bishop can travel to the targeted square in one move. Otherwise print â€œNoâ€ (without the quote) in a single line.\r\n\r\nSample\r\n\r\nInput	\r\n3\r\n5 6 5 1\r\n1 1 2 3\r\n3 4 5 2\r\n\r\nOutput\r\n\r\nNo\r\nNo\r\nYes', 'toph', '3\r\n5 6 5 1\r\n1 1 2 3\r\n3 4 5 2', 'No\r\nNo\r\nYes\r\n', 'No\nNo\nYes\n', 3.00),
(62, 'Merit Position', 'The Final result is out. All the student of the class know their CGPA. But they don''t know their merit position.\r\n\r\nSo your task is to write a program which will calculate the merit position of the student of the class.\r\n\r\nIf two or more student have the same CGPA then they will have the same merit position. In this case print their name in Dictionary order.\r\nInput:\r\n\r\nFirst line of the input consist of N<=50 the number of student of the class then the next N line each consist of one string S of not more than 100 character and one floating point number 2<=F<=4 denoting the name of the student and the CGPA of the student.\r\nOutput:\r\n\r\nOutput consist of merit position of the student and the name of the student. For detail check the sample output.\r\nSample Input\r\n\r\n4\r\nRobin 3.67\r\nMoin 3.68\r\nSohag 3.69\r\nTazz 3.68\r\n\r\nSample Output\r\n1.Sohag\r\n2.Moin\r\n2.Tazz\r\n3.Robin\r\n', 'DevSkill', '5\r\nAshadullah 3.20\r\nAaashish 3.90\r\nAaabbas 3.80\r\nAaaanish 3.80\r\nShawon 3.16', '1.Aaashish\r\n2.Aaaanish\r\n2.Aaabbas\r\n3.Ashadullah\r\n4.Shawon\r\n', '1.Aaashish\n2.Aaaanish\n2.Aaabbas\n3.Ashadullah\n4.Shawon\n', 3.00),
(63, 'Greetings', 'After that the code will select a random problem for you from my problems database based on your previously solved problems, your skills and your weaknesses. But while I was coding for implementing this great idea, I found that, all of my problems are scattered in 2 computers. So, I have to merge them before running my code.\r\n\r\nNow you are given the number of problems in each of the computers, you have to find the total number of problems. You can safely assume that no problem is stored in multiple computers. So, all the problems are distinct.\r\n\r\nInput\r\nInput starts with an integer T (â‰¤ 125), denoting the number of test cases.\r\n\r\nEach case starts with a line containing two integers a and b. a denotes the number of problems in the first computer and b denotes the number of problems in the second computer. You can safely assume that a and b will be non-negative and not greater than 10.\r\n\r\nOutput\r\nFor each case, print the case number and the total number of problems. See the samples for exact formatting.\r\n\r\nSample Input\r\n2\r\n1 7\r\n9 8\r\n\r\nOutput for Sample Input\r\n\r\nCase 1: 8\r\nCase 2: 17', 'lightoj', '2\r\n1 7\r\n9 8\r\n', 'Case 1: 8\r\nCase 2: 17\r\n', 'Case 1: 8\nCase 2: 17\n', 3.00),
(64, 'RUET', 'In ECE Faculty Of RUET There are 4 departments. These are EEE, CSE, ETE AND ECE. For Each Department There is a department code . \r\n\r\nEEE- 2\r\nCSE- 3\r\nETE- 4\r\nECE- 11\r\n\r\nYour teacher asked  you to write a program that will take department code as input and print out department name as output. If department code is incorrect then print invalid\r\n\r\nInput\r\nInput starts with an integer T (â‰¤ 125), denoting the number of test cases.\r\n\r\nEach case starts with a line containing a integer n denoting department code. \r\n\r\n\r\nOutput\r\n\r\nOutput is department name\r\n\r\nSample Input\r\n\r\n2\r\n3\r\n2\r\n\r\nSample Output\r\n\r\nCSE\r\nEEE', 'shawon', '5\r\n3\r\n2\r\n11\r\n4\r\n120\r\n', 'CSE\r\nEEE\r\nECE\r\nETE\r\ninvalid\r\n', 'CSE\nEEE\nECE\nETE\ninvalid\n', 3.00),
(67, 'Prime generator', ' Peter wants to generate some prime numbers for his cryptosystem. Help him! Your task is to generate all prime numbers between two given numbers!\r\nInput\r\n\r\nThe input begins with the number t of test cases in a single line (t<=10). In each of the next t lines there are two numbers m and n (1 <= m <= n <= 1000000000, n-m<=100000) separated by a space.\r\nOutput\r\n\r\nFor every test case print all prime numbers p such that m <= p <= n, one number per line, test cases separated by an empty line.\r\nExample\r\n\r\nInput:\r\n2\r\n1 10\r\n3 5\r\n\r\nOutput:\r\n2\r\n3\r\n5\r\n7\r\n3\r\n5\r\n\r\nWarning: large Input/Output data, be careful with certain languages (though most should be OK if the algorithm is well designed)', 'shawon', '1\r\n100000500 100000600', '100000541\r\n100000543\r\n100000561\r\n100000567\r\n100000577\r\n', '', 3.00),
(68, 'Many a little makes a mickle', 'Little girl Rifat likes to travel . She has made a plan for travelling whole world. But she has not enough money to travel. So she has started to collect money. She has started from 1 taka and every day this amount is increased by one like second day 2 taka, third day 3 taka and so on. Now she wants to know how much she can collect in Nth day. So Rifat has asked you to write a program to find total money that she can collect till nth day .\r\n\r\nInput\r\n\r\nInput starts with test case t. Next t lines has an integer 1<=n<=1000000000 . \r\n\r\nOutput\r\n\r\nOutput is an integer that is total money that she can collect in nth day.\r\n\r\nInput\r\n3\r\n5\r\n6\r\n10\r\n\r\n\r\nOutput\r\n15\r\n21\r\n55\r\n', 'shawon', '3\r\n100000000\r\n1000000000\r\n200000000', '5000000050000000\r\n500000000500000000\r\n20000000100000000\r\n', '5000000050000000\n500000000500000000\n20000000100000000\n', 3.00),
(71, 'Magic Square', 'In recreational mathematics, a magic square  is a n Ã— n  square grid (where  n is the number of cells on each side) filled with distinct positive integers. Example :\r\n                                                     \r\n                                                       \r\n                                                                   8   1  6\r\n                                                                   3   5  7\r\n                                                                   4   9  2\r\n\r\n\r\n\r\nLook Carefully . Here In (3*3) Grid, Sum of each side (Horizontally, Diagonally And Vertically)  is  15. Similarly in 5*5 grid Sum of each side is 65\r\n\r\n                                                                   17 24  1  8 15\r\n                                                                   23  5  7 14 16\r\n                                                                    4  6 13 20 22\r\n                                                                   10 12 19 21  3\r\n                                                                   11 18 25  2  9\r\n\r\n\r\nCurious mind wants to know  what will be the sum of each side if n is 7, 9,11 ........ and so on. Here n is an odd number. \r\n\r\nInput\r\n\r\nInput starts with test case t<=50. Next t lines has an integer (odd number) 1<n<=9999 . \r\n\r\nOutput\r\n\r\nOutput is  Sum of each side of Magic Square.\r\n\r\nInput\r\n\r\n2\r\n3\r\n5\r\n\r\nOutput\r\n\r\n15\r\n65', 'shawon', '50\r\n9899\r\n9901\r\n9903\r\n9905\r\n9907\r\n9909\r\n9911\r\n9913\r\n9915\r\n9917\r\n9919\r\n9921\r\n9923\r\n9925\r\n9927\r\n9929\r\n9931\r\n9933\r\n9935\r\n9937\r\n9939\r\n9941\r\n9943\r\n9945\r\n9947\r\n9949\r\n9951\r\n9953\r\n9955\r\n9957\r\n9959\r\n9961\r\n9963\r\n9965\r\n9967\r\n9969\r\n9971\r\n9973\r\n9975\r\n9977\r\n9979\r\n9981\r\n9983\r\n9985\r\n9987\r\n9989\r\n9991\r\n9993\r\n9995\r\n9999\r\n', '485002504799\r\n485296534801\r\n485590683615\r\n485884951265\r\n48617