(72, 'Bangla Date', 'Suppose you are a web developer. Your client asked you to make a php script for his website  that can convert English Date to Bangla Date. Suppose if user type 16 03 2017 then output will be 2 Choitra 12 1423 . Here 12 is month number . For simplicity only consider following bangla month\r\n\r\nBangla Month Name Format\r\n\r\nFalgun\r\nChoitra\r\nSrabon\r\nAshwin\r\nPoush\r\n\r\n\r\n\r\n\r\nInput\r\n\r\nInput starts with an integer T (â‰¤ 50000), denoting the number of test cases.\r\n\r\nOutput \r\n\r\nOutput is bangla date\r\n\r\nInput\r\n\r\n1\r\n16 03 2017\r\n\r\nOutput\r\n\r\n2 Choitra 12 1423', 'shawon', '5\r\n16 03 2017\r\n12 08 2016\r\n16 09 2016\r\n29 02 2016\r\n31 12 2017', '2 Choitra 12 1423\r\n28 Srabon 4 1423\r\n1 Ashwin 6 1423\r\n17 Falgun 11 1422\r\n17 Poush 9 1424\r\n', '2 Choitra 12 1423\n28 Srabon 4 1423\n1 Ashwin 6 1423\n17 Falgun 11 1422\n17 Poush 9 1424\n', 3.00),
(73, 'Finding Divisor', 'Problem Statement is very easy. Just Find out number of divisors of a given number.\r\n\r\nInput\r\n\r\nnput starts with an integer T (â‰¤ 10), denoting the number of test cases.\r\n\r\nEach case starts with an integer m (1<=m<=1000000000000) . \r\n\r\nOutput\r\n\r\nOutput is number of divisors of m\r\n\r\nInput\r\n\r\n2\r\n12\r\n15\r\n\r\nOutput\r\n\r\n6\r\n4', 'shawon', '5\r\n1000000000000\r\n500000000\r\n6000000000\r\n700000000\r\n8000000000', '169\r\n90\r\n220\r\n162\r\n130\r\n', '169\n90\n220\n162\n130\n', 3.00),
(74, 'Digit Counter', 'You are asked to write a program that count number of digits. But I will not give you direct number. I will give you a number. you have to find out the factorial of that number. Now it is your number . So now count the digits of your number\r\n\r\n\r\nInput\r\nInput starts with an integer T (<= 50000), denoting the number of test cases.\r\n\r\nEach case begins with one integer n (0 < n <= 1000000)\r\n\r\nOutput\r\n\r\nOutput is total number of digit of your number that you find out .\r\n\r\nInput\r\n3\r\n5\r\n3\r\n1000000\r\n\r\nOutput\r\n3\r\n1\r\n5565709', 'shawon', '3\r\n1000000\r\n500000\r\n300000\r\n', '5565709\r\n2632342\r\n1512852\r\n', '5565709\n2632342\n1512852\n', 1.00),
(75, 'Searching For GF', 'Abu asif khan chowdhury is a very richman.But today asif is so sad because he has no girlfriend.So.he is thinking about what he should do.After thinking a while he discoveres a new idea.In the upcoming valentience day he will propose the girls who are still single by giving roses as a symbol of love.For this he goes to market and buy n roses.He wants to distribute roses among the maximum number of girls in such a way that each girls would get distinct positive integer number of roses.As he is busy with his work ,your task is to find the maximum number of girls he can give roses if he gives distinct number of roses to each girls.Among the girls who would get the maximum number of roses accept his propose and would become his girlfriend.You will also have to determine the maximum number of roses his girlfried can get from him.\r\n\r\nInput:\r\nIn the first line contains t (0<t<20),the number of test cases. the following t lines will contain the n(0<n<1001),the number of roses asif buys from the market.\r\n\r\nOutput: \r\n\r\nPrint the case number as shown in sample output,then print k,the maximum number of girls asif can give roses such that each one will get the distinct positive number of roses.Then print a space and print m ,maximum number of roses his girlfriend will get from him.Each output will seperated by a new line.\r\n\r\nsample input:\r\n3\r\n9\r\n5\r\n7\r\nsample output:\r\nCase 1:3 6\r\nCase 2:2 4\r\nCase 3:3 4\r\n\r\nN:B : In first test case asif can give roses maximum 3 girls. 3girls will get 1,2,6 roses respectively. So,maximum 6roses his GF will get from him. ', 'ASIB', '4\r\n1000\r\n8\r\n1\r\n20', 'Case 1:44 54\r\nCase 2:3 5\r\nCase 3:1 1\r\nCase 4:5 10\r\n', '', 1.00);
