('shawon', '#include <bits/stdc++.h>\r\nusing namespace std;\r\n#define n 10000000\r\nvector<long long int>s;\r\nlong long int p[n],k=1,size;\r\nbool a[n];\r\nlong long int prime()\r\n{\r\n    long long i,j;\r\n    a[0]=a[1]=1;\r\n    for(i=4;i<=n;i=i+2)\r\n    {\r\n        a[i]=1;\r\n    }\r\n    for(i=3;i<=sqrt(n);i=i+2)\r\n    {\r\n        for(j=i*i;j<=n;j=j+2*i)\r\n        {\r\n            a[j]=1;\r\n        }\r\n    }\r\n    for(i=2;i<=n;i++)\r\n    {\r\n        if(a[i]==0)\r\n        {\r\n            p[k]=i;\r\n            //cout<<p[k]<<endl;\r\n            k++;\r\n        }\r\n    }\r\n\r\n\r\n}\r\n\r\nlong long int isprime(long long int v)\r\n{\r\n    long long int x;\r\n    if(v<=n)\r\n    {\r\n        if(a[v]==0)\r\n        {\r\n            return 1;\r\n        }\r\n        else\r\n        {\r\n            return 0;\r\n        }\r\n    }\r\n    else if(v>n)\r\n    {\r\n    for(x=1;x<=k && p[x]<=sqrt(v);x++)\r\n    {\r\n        if(v%p[x]==0)\r\n        {\r\n            return 0;\r\n        }\r\n    }\r\n    }\r\n\r\n    return 1;\r\n}\r\n\r\n\r\nvoid generate_prime(long long int f, long long int t)\r\n{\r\n    s.clear();\r\n    long long int y,in=0;\r\n    for(y=f;y<=t;y++)\r\n    {\r\n\r\n        if(isprime(y))\r\n        {\r\n            s.push_back(y);\r\n            cout<<s[in]<<endl;\r\n            in++;\r\n        }\r\n    }\r\n\r\n    \r\n\r\n\r\n}\r\n\r\nint main()\r\n{\r\n     long long int m,g,c,r,t,l,h,u,w,tc,tx;\r\n\r\n     prime();\r\n     cin>>tc;\r\n\r\n     for(tx=1;tx<=tc;tx++)\r\n     {\r\n\r\n        cin>>l>>u;\r\n        generate_prime(l,u);\r\n\r\n\r\n     }\r\n\r\n\r\n\r\n    return 0;\r\n}\r\n\r\n', 182),
