('shawon', '#include <bits/stdc++.h>\r\nusing namespace std;\r\n#define n 10000000\r\nvector<long long int>s,sg,segment;\r\nlong long int p[n],k=1,size;\r\nbool a[n];\r\nlong long int prime()\r\n{\r\n    long long i,j;\r\n    a[0]=a[1]=1;\r\n    for(i=4;i<=n;i=i+2)\r\n    {\r\n        a[i]=1;\r\n    }\r\n    for(i=3;i<=sqrt(n);i=i+2)\r\n    {\r\n        for(j=i*i;j<=n;j=j+2*i)\r\n        {\r\n            a[j]=1;\r\n        }\r\n    }\r\n    p[0]=2;\r\n    for(i=3;i<=n;i=i+2)\r\n    {\r\n        if(a[i]==0)\r\n        {\r\n            p[k]=i;\r\n            //cout<<p[k]<<endl;\r\n            k++;\r\n        }\r\n    }\r\n\r\n\r\n}\r\n\r\nvoid segmented_sieve(long long int l,long long int u)\r\n{\r\n    long long int root,start,i,j,si;\r\n    sg.clear();\r\n    root=sqrt(u)+1;\r\n\r\n\r\n\r\n    for(i=l;i<=u;i++)\r\n    {\r\n        sg.push_back(i);\r\n    }\r\n\r\n\r\n    if(l==0)\r\n    {\r\n        sg[1]=0;\r\n    }\r\n    else if(l==1)\r\n    {\r\n        sg[0]=0;\r\n    }\r\n\r\n\r\n\r\n    for(i=0;p[i]<=root;i++)\r\n    {\r\n        si=p[i];\r\n\r\n        start=si*si;\r\n\r\n        if(start<l)\r\n        {\r\n            start=((l+si-1)/si)*si;\r\n        }\r\n\r\n\r\n        for(j=start;j<=u;j=j+si)\r\n        {\r\n            sg[j-l]=0;\r\n\r\n        }\r\n    }\r\n\r\n}\r\n\r\nint main()\r\n{\r\n     long long int m,g,c,r,t,l,h,u,w,tc,tx,i,j;\r\n\r\n     prime();\r\n     cin>>tc;\r\n\r\n     for(tx=1;tx<=tc;tx++)\r\n     {\r\n\r\n        cin>>l>>u;\r\n        segmented_sieve(l,u);\r\n\r\n        for(i=l;i<=u;i++)\r\n        {\r\n\r\n\r\n            if(sg[i-l]!=0)\r\n            {\r\n                segment.push_back(sg[i-l]);\r\n            }\r\n        }\r\n\r\n        for(i=0;i<segment.size();i++)\r\n        {\r\n            cout<<segment[i]<<endl;\r\n        }\r\n        segment.clear();\r\n        sg.clear();\r\n        cout<<endl;\r\n\r\n\r\n\r\n     }\r\n\r\n\r\n\r\n    return 0;\r\n}', 196),
