('shawon', '#include <bits/stdc++.h>\r\nusing namespace std;\r\n#define n 1000005\r\nbool a[n];\r\nlong long int k=1;\r\nlong long int twin[n];\r\nvoid sieve()\r\n{\r\n    long long int i,j;\r\n    a[0]=a[1]=1;\r\n    for(i=4;i<=n;i=i+2)\r\n    {\r\n        a[i]=1;\r\n    }\r\n    for(i=3;i<=sqrt(n);i=i+2)\r\n    {\r\n        for(j=i*i;j<=n;j=j+2*i)\r\n        {\r\n            a[j]=1;        //3*3, 3*5,3*7.....\r\n        }\r\n    }\r\n    for(i=2;i<=n;i++)\r\n    {\r\n        if(a[i]==0)\r\n        {\r\n           twin[k]=i;\r\n           k++;\r\n        }\r\n    }\r\n\r\n}\r\nint main()\r\n{\r\n    long long int m,g,c,r,s,t,l,h;\r\n    //ifstream in ("1028.txt");\r\n    //ofstream out("out1028.txt");\r\n    //freopen("fdin.txt","r",stdin);\r\n    //freopen("fdout.txt","w",stdout);\r\n    cin>>t;\r\n    //in>>t;\r\n    sieve();\r\n    for(l=1;l<=t;l++)\r\n    {\r\n        cin>>m;\r\n        //in>>m;\r\n        r=1;\r\n        h=0;\r\n        for(g=1;g<=k && twin[g]<=sqrt(m);g++)\r\n        {\r\n            c=0;\r\n            if(m%twin[g]==0)\r\n            {\r\n\r\n            while(m%twin[g]==0)\r\n            {\r\n                c++;\r\n                m=m/twin[g];\r\n                if(m==0 || m==1)\r\n                {\r\n                    break;\r\n                }\r\n\r\n             }\r\n              s=c+1;\r\n              r=r*s;\r\n            }\r\n\r\n\r\n\r\n        }\r\n        if(m!=1)\r\n        {\r\n            r=r*2;    //for prime numbers there are only 2 divisors.\r\n        }\r\n\r\n        printf("%lld\n",r);\r\n        //out<<"Case "<<l<<":"<<" "<<r-1<<endl;\r\n\r\n    }\r\n\r\n    return 0;\r\n}\r\n', 229),
